feedback_ui_template.message:
1- Περιγράψτε το πρόβλημα που αντιμετωπίζετε.
2- Το ζήτημα παρουσιάστηκε ενώ προσπαθούσατε να ανοίξετε ένα αρχείο ή ενώ προσπαθούσατε να επεξεργαστείτε ένα αρχείο;
3- Αυτό το ζήτημα παρουσιάζεται κάθε φορά που προσπαθείτε να ανοίξετε ή να επεξεργαστείτε κάποιο αρχείο ή μόνο με συγκεκριμένα αρχεία;

Εάν αυτό το ζήτημα αφορά συγκεκριμένα ένα αρχείο, μη διστάσετε να επισυνάψετε αυτό το αρχείο στην αναφορά, καθώς θα μας βοηθήσει σημαντικά να επιλύσουμε αποτελεσματικότερα αυτό το ζήτημα.
